  render() {
    return <div>Component</div>
  }
}

class CompLeft extends Component {
    render() {
        return <div><Component/></div>}
}

class CompRight extends Component {
    render() {
        return <div><Component/></div>}
}

export {Comp,CompLeft,CompRight}
